window.initMap=()=>{const e=document.getElementById("address"),o=document.getElementById("search"),a=new google.maps.Geocoder;o.addEventListener("click",(()=>{console.log(e.value),a.geocode({address:e.value},(function(e,o){if("OK"==o){const o={location:new google.maps.LatLng(e[0].geometry.location.lat(),e[0].geometry.location.lng()),radius:"5000",type:["restaurant"]};new google.maps.places.PlacesService(document.createElement("div")).nearbySearch(o,((e,o)=>{o==google.maps.places.PlacesServiceStatus.OK&&e.forEach((e=>{console.log(e);const o={placeId:e.place_id};new google.maps.places.PlacesService(document.createElement("div")).getDetails(o,((e,o)=>{o==google.maps.places.PlacesServiceStatus.OK&&console.log(e)}))}))}))}else alert("Geocode was not successful for the following reason: "+o)}))}))};